import React from "react";
import { Table } from "reactstrap";
import style from "./ProductTable.module.css";
import { NavLink } from "react-router-dom";

function ProductTable(props) {
    const { data } = props;

    const tableRows = data.map((product) => {
        return (
            <tr className="align-self-center" key={data && product.id}>

                <td  className={style.image}>
                    <img src={product.image_link} alt={data && product.name} />
                </td>

                <td className={style.category}>{product.name}</td>

                <td>{product.product_type}</td>

                <td>{product.price}$</td>

                <td>
                    <NavLink to={`/product/${product.id}`}>
                        <button> show product  </button>
                    </NavLink>
                </td>
            </tr>
        );
    });

    return (
        <div className={`px-4 py-3 ${style.tablebgd}`}>
        <Table responsive>
            <thead>
            <tr>
                <th>Image</th>
                <th>Name</th>
                <th>Category</th>
                <th>Price</th>
                <th> Details </th>

            </tr>
            </thead>
            <tbody>{tableRows}</tbody>
        </Table>
        </div>
    );
}

export default ProductTable;
